    false,nt"url": null,nt"notes": "TASK NAME:FY 2012 GEORGIA DNR ELEVATION
    DATA NOAA Contract No. EA133C11CQ0010 Requisition No. NCNP0000-11-02615 Woolpert
    Order No. 71511 CONTRACTOR: Woolpert, Inc. The PSFY12 GADNR Elevation Data Task
    Order involves: collecting and delivering topographic elevation point data derived
    from multiple return light detection and ranging (LiDAR) measurements for portions
    of 4 counties in Georgia. The Statement of Work (SOW) was developed by the National
    Oceanic and Atmospheric Administration's (NOAA) Coastal Services Center (referred
    to as the Center) in partnership with the Georgia Department of Natural Resources
    (GADNR) Environmental Protection Division (EPD). The counties included Floyd, Polk,
    Paulding and Oconee. The purpose of the data is for use in coastal management decision
    making, including applications such as flood plain mapping and water rights management.
    LiDAR was collected at 1.0 points per square meter (1.0m GSD) for the portions of
    Floyd, Polk, Paulding and Oconee Counties. This area was flown during snow free
    and leaf-off conditions.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
